    {ntt"total": 28,ntt"recent": 0nt},nt"groups": [],nt"relationships_as_subject":
    [],nt"revision_timestamp": "2015-09-27T01:37:06.757958",nt"name": "noaa-office-for-coastal-management-sea-level-rise-data-1-6-ft-sea-level-rise-inundation-extent",nt"isopen":
    false,nt"url": null,nt"notes": "These data were created as part of the
    National Oceanic and Atmospheric Administration Office for Coastal Management's
    efforts to create an online mapping viewer depicting potential sea level rise and
    its associated impacts on the nation's coastal areas. The purpose of the mapping
    viewer is to provide coastal managers and scientists with a preliminary look at
    sea level rise (slr) and coastal flooding impacts. The viewer is a screening-level
    tool that uses nationally consistent data sets and analyses.Data and maps provided
    can be used at several scales to help gauge trends and prioritize actions for different
    scenarios. The Sea Level Rise and Coastal Flooding Impacts Viewer may be accessed
    at: http://www.coast.noaa.gov/slr These data depict the potential inundation of
    coastal areas resulting from a projected 1 to 6 feet rise in sea level above current
    Mean Higher High Water (MHHW) conditions. The process used to produce the data can
    be described as a modified bathtub approach that attempts to account for both local/regional
    tidal variability as well as hydrological connectivity. The process uses two source
    datasets to derive the final inundation rasters and polygons and accompanying low-lying
    polygons for each iteration of sea level rise: the Digital Elevation Model (DEM)
    of the area and a tidal surface model that represents spatial tidal variability.
    The tidal model is created using the NOAA National Geodetic Survey's VDATUM datum
    transformation software (http://vdatum.noaa.gov) in conjunction with spatial interpolation/extrapolation
    methods and represents the MHHW tidal datum in orthometric values (North American
    Vertical Datum of 1988). The model used to produce these data does not account for
    erosion, subsidence, or any future changes in an area's hydrodynamics. It is simply
    a method to derive data in order to visualize the potential scale, not exact location,
    of inundation from sea level rise.",nt"license_title": null,nt"extras":
